import React from 'react'
import "../stylesheets/Star.css"


class Star extends React.Component {

    render(){

        return (
            <div className={this.props.star.class_name}
                 style={{left: this.props.star.size, top: this.props.star.size}}
            >
            </div>
        )

    }
}

export default Star
